import React from 'react';
import ExList from '../view/ExList';
import AddIcon from '@material-ui/icons/Add';
import { IconButton } from '@material-ui/core';

class ExListContainer extends React.Component {
  state = {
    data: [
      {
        id: 'root',
        name: '티베로설치법',
        children: [
          {
            id: '1',
            name: '1',
            children: [
              {
                id: '8',
                name: '8',
              },
            ],
          },
          {
            id: '3',
            name: '3',
            children: [
              {
                id: '4',
                name: '4',
              },
            ],
          },
        ],
      },
      {
        id: 'root',
        name: '티베로 삭제법',
        children: [
          {
            id: '5',
            name: '5',
          },
          {
            id: '6',
            name: '6',
            children: [
              {
                id: '7',
                name: '7',
              },
            ],
          },
        ],
      },
    ],
  };

  render() {
    const data = this.state.data;
    console.log(data);
    return (
      <>
        <IconButton arial-labe="Add root UK">
          <AddIcon />
        </IconButton>
        {data.map(object => (
          <ExList key={object.id} data={object} />
        ))}
      </>
    );
  }
}

export default ExListContainer;
